import React, { useState, useEffect, useMemo } from 'react';
import {
  Container,
  Grid,
  Button,
  Typography,
  Box,
  Paper,
  Alert,
  CircularProgress,
  ButtonGroup,
  IconButton,
  Tooltip
} from '@mui/material';
import UndoIcon from '@mui/icons-material/Undo';
import { v4 as uuidv4 } from 'uuid';

interface SequenceItem {
  symbol: number;
  created_at: string;
}

interface AnalysisData {
  markovChain?: {
    matrix?: number[][]; 
    predictedNext?: number;
    confidence: number;
  };
  entropy?: {
    value?: number; 
    predictedNext?: number;
    confidence: number;
  };
  chiSquare?: {
    value?: number; 
    predictedNext?: number;
    confidence: number;
  };
  monteCarlo?: {
    predictedNext?: number;
    confidence: number;
  };
}

interface SequenceResponse {
  success: boolean;
  batchId: string;
  sequence: SequenceItem;
}

interface WebSocketUpdate {
  type: 'sequence_update';
  data: {
    analysisResults: AnalysisData;
    sequence: SequenceItem;
  };
}

interface ErrorState {
  message: string;
  type: 'error' | 'warning' | 'info';
  timestamp: number;
}

// Backend API response interface
interface BackendAnalysisResponse {
  symbols: number;
  tools: string[];
  sampleAnalysis: {
    matrix: Record<string, Record<string, number>>;
    prediction: number;
    confidence: number;
    accuracy: number;
  };
}

// API Configuration
const API_BASE_URL = 'http://localhost:5000';
const API_ENDPOINTS = {
  SEQUENCES: `${API_BASE_URL}/api/sequences`,
  ANALYSIS: `${API_BASE_URL}/api/analysis`,
  ADD_SYMBOL: `${API_BASE_URL}/api/sequences/symbol`,
  UNDO: `${API_BASE_URL}/api/sequences/undo`,
  GENERATE: `${API_BASE_URL}/api/sequences/generate-test-data`,
  RESET: `${API_BASE_URL}/api/sequences/reset`
};

// Debug fetch wrapper
const debugFetch = async (url: string, options: RequestInit = {}) => {
  console.group(`API Call: ${options.method || 'GET'} ${url}`);
  console.log('Request Options:', options);

  try {
    const response = await fetch(url, options);
    console.log('Response Status:', response.status);

    if (!response.ok) {
      console.error('Response Error:', response.statusText);
      throw new Error(`HTTP error! status: ${response.status}`);
    }

    const data = await response.json();
    console.log('Response Data:', data);
    return data;
  } catch (error) {
    console.error('Fetch Error:', error);
    throw error;
  } finally {
    console.groupEnd();
  }
};

// Matrix transformation helper
const transformMatrix = (matrixRecord: Record<string, Record<string, number>> | undefined): number[][] => {
  if (!matrixRecord) return [];

  const keys = Object.keys(matrixRecord).sort((a, b) => Number(a) - Number(b));
  return keys.map(row => 
    keys.map(col => matrixRecord[row][col] || 0)
  );
};

// Analysis data transformer
const transformAnalysisData = (backendData: BackendAnalysisResponse | null): AnalysisData => {
  if (!backendData?.sampleAnalysis) {
    return {
      markovChain: { confidence: 0.25 },
      entropy: { confidence: 0.25 },
      chiSquare: { confidence: 0.25 },
      monteCarlo: { confidence: 0.25 }
    };
  }

  const { prediction, confidence, matrix } = backendData.sampleAnalysis;

  return {
    markovChain: {
      matrix: transformMatrix(matrix),
      predictedNext: prediction,
      confidence
    },
    entropy: {
      predictedNext: prediction,
      confidence,
      value: confidence
    },
    chiSquare: {
      predictedNext: prediction,
      confidence,
      value: confidence
    },
    monteCarlo: {
      predictedNext: prediction,
      confidence
    }
  };
};

const GameAnalysisPage: React.FC = () => {
  const [sequence, setSequence] = useState<SequenceItem[]>([]);
  const [analysisData, setAnalysisData] = useState<AnalysisData>({});
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<ErrorState | null>(null);
  const [retryCount, setRetryCount] = useState(0);
  const MAX_RETRIES = 3;

  const symbols = ['♠', '♥', '♦', '♣'];

  const sessionId = useMemo(() => uuidv4(), []);

  const handleError = (message: string, type: ErrorState['type'] = 'error') => {
    setError({
      message,
      type,
      timestamp: Date.now()
    });

    if (type === 'error') {
      setRetryCount(prev => prev + 1);
    }
  };

  useEffect(() => {
    if (retryCount >= MAX_RETRIES) {
      handleError('Maximum retry attempts reached. Please refresh the page.', 'warning');
    }
  }, [retryCount]);

  useEffect(() => {
    const socket = new WebSocket(`ws://localhost:5000/ws/${sessionId}`);

    socket.onmessage = (event) => {
      try {
        const update: WebSocketUpdate = JSON.parse(event.data);
        if (update.type === 'sequence_update') {
          console.log('WebSocket update received:', update.data);
          const transformedData = transformAnalysisData(update.data as unknown as BackendAnalysisResponse);
          console.log('Transformed WebSocket data:', transformedData);
          setAnalysisData(transformedData);
        }
      } catch (error) {
        console.error('Error processing WebSocket message:', error);
      }
    };

    socket.onerror = (error) => {
      console.error('WebSocket error:', error);
      handleError('WebSocket connection error');
    };

    return () => {
      socket.close();
    };
  }, [sessionId]);

  const loadData = async () => {
    try {
      setLoading(true);
      setError(null);

      const [sequenceData, analysisData] = await Promise.all([
        debugFetch(API_ENDPOINTS.SEQUENCES),
        debugFetch(API_ENDPOINTS.ANALYSIS)
      ]);

      console.log('Raw API Response:', analysisData);

      if (sequenceData.sequence) {
        setSequence(sequenceData.sequence);
      }

      setAnalysisData(transformAnalysisData(analysisData));

    } catch (error) {
      console.error('Error loading data:', error);
      handleError(error instanceof Error ? error.message : 'Failed to load data');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadData();
  }, []);

  const handleCardClick = async (index: number) => {
    try {
      if (retryCount >= MAX_RETRIES) {
        handleError('Please refresh the page to continue.', 'warning');
        return;
      }

      setLoading(true);
      setError(null);

      const data = await debugFetch(API_ENDPOINTS.ADD_SYMBOL, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ symbol: index })
      });

      setSequence(prev => [...prev, {
        symbol: index,
        created_at: new Date().toISOString()
      }]);

    } catch (error) {
      console.error('Error:', error);
      handleError(error instanceof Error ? error.message : 'Failed to submit sequence');
    } finally {
      setLoading(false);
    }
  };

  const undoLastSymbol = async () => {
    try {
      await debugFetch(API_ENDPOINTS.UNDO, {
        method: 'DELETE'
      });
      await loadData();
    } catch (error) {
      handleError(error instanceof Error ? error.message : 'Failed to undo last symbol');
    }
  };

  const generateTestData = async () => {
    try {
      setError(null);
      setLoading(true);

      await debugFetch(API_ENDPOINTS.GENERATE, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        }
      });

      await loadData();
    } catch (error) {
      handleError(error instanceof Error ? error.message : 'Failed to generate test data');
    } finally {
      setLoading(false);
    }
  };

  const resetDatabase = async () => {
    try {
      setError(null);
      await debugFetch(API_ENDPOINTS.RESET, {
        method: 'POST'
      });
      await loadData();
      handleError('Database reset successfully', 'info');
    } catch (error) {
      handleError(error instanceof Error ? error.message : 'Failed to reset database');
    }
  };

  const renderAnalysisValue = (name: string, data: any) => {
    if (!data) return 'No Data Available';

    // Safely handle each analysis type
    if (name === 'Markov' && Array.isArray(data.matrix)) {
      return `Matrix: ${data.matrix.length}x${data.matrix[0]?.length ?? 0}`;
    }

    if (['Entropy', 'Chi²'].includes(name) && data.value !== undefined) {
      return `Value: ${data.value.toFixed(3)}`;
    }

    if (name === 'Monte Carlo') {
      return ''; // No value to display
    }

    return 'N/A';
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      {error && (
        <Alert 
          severity={error.type}
          onClose={() => setError(null)}
          sx={{ mb: 2 }}
        >
          {error.message}
          {error.type === 'warning' && (
            <Button
              size="small"
              onClick={() => window.location.reload()}
              sx={{ ml: 2 }}
            >
              Refresh Page
            </Button>
          )}
        </Alert>
      )}

      <Grid container spacing={3}>
        {/* Game Controls */}
        <Grid item xs={12} md={4}>
          <Paper elevation={3} sx={{ p: 3 }}>
            <Typography variant="h5" gutterBottom>
              Game Controls
            </Typography>
            <Box sx={{ mb: 3 }}>
              <ButtonGroup 
                variant="contained" 
                size="large"
                sx={{ 
                  mb: 2,
                  '& .MuiButton-root': {
                    fontSize: '1.5rem',
                    padding: '12px 24px',
                  }
                }}
              >
                {symbols.map((symbol, index) => (
                  <Button
                    key={symbol}
                    onClick={() => handleCardClick(index)}
                    disabled={loading}
                  >
                    {symbol}
                  </Button>
                ))}
              </ButtonGroup>
            </Box>
            <Box sx={{ display: 'flex', alignItems: 'center', mb: 3 }}>
              <Button
                variant="contained"
                onClick={generateTestData}
                disabled={loading}
                sx={{ mr: 2 }}
              >
                Generate Test Data
              </Button>
              <IconButton 
                onClick={undoLastSymbol}
                disabled={loading || sequence.length === 0}
                color="primary"
                size="large"
              >
                <UndoIcon fontSize="large" />
              </IconButton>
              <Button
                variant="outlined"
                color="error"
                onClick={resetDatabase}
                disabled={loading}
                sx={{ ml: 2 }}
              >
                Reset DB
              </Button>
            </Box>
            <Typography variant="h6">
              Total Symbols: {sequence.length}
            </Typography>
          </Paper>
        </Grid>

        {/* Analysis Results */}
        <Grid item xs={12} md={5}>
          <Paper elevation={3} sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Analysis Results
            </Typography>
            {loading ? (
              <Box sx={{ display: 'flex', justifyContent: 'center', p: 2 }}>
                <CircularProgress />
              </Box>
            ) : (
              <Grid container spacing={2}>
                {Object.entries({
                  'Markov': analysisData.markovChain,
                  'Entropy': analysisData.entropy,
                  'Chi²': analysisData.chiSquare,
                  'Monte Carlo': analysisData.monteCarlo
                }).map(([name, data]) => (
                  data && (
                    <Grid item xs={8} key={name}>
                      <Paper 
                        elevation={1} 
                        sx={{ 
                          p: 1, 
                          backgroundColor: 'background.default',
                          height: '100%'
                        }}
                      >
                        <Typography variant="subtitle2" sx={{ fontWeight: 'bold' }}>
                          {name}
                        </Typography>
                        <Typography variant="body2" sx={{ mt: 0.5 }}>
                          {renderAnalysisValue(name, data)}
                        </Typography>
                        <Typography variant="body2">
                          Next: <strong>
                            {data.predictedNext !== undefined && data.predictedNext !== null
                              ? symbols[data.predictedNext]
                              : 'N/A'}
                          </strong>
                        </Typography>
                        <Typography variant="caption" display="block" color="text.secondary">
                          Conf: {data.confidence ? `${(data.confidence * 100).toFixed(0)}%` : 'N/A'}
                        </Typography>
                      </Paper>
                    </Grid>
                  )
                ))}
              </Grid>
            )}
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
};

export default GameAnalysisPage;
